// src/pages/Home.jsx
import React, { useState } from "react";
import { motion, AnimatePresence } from "framer-motion";
import gundamHead from "../assets/images/gundamhead.png";

const phrases = [
  "ðŸš€ Fast Delivery",
  "ðŸ’¸ Affordable Prices",
  "âœ… Quality Guaranteed",
  "ðŸ“ž 24/7 Support"
];

const titles = ["Overview", "Who is it for", "Why join us?"];

const Home = () => {
  const [phraseIndex, setPhraseIndex] = useState(0);
  const [titleIndex, setTitleIndex] = useState(0);

  const handleNext = () =>
    setPhraseIndex((prev) => (prev + 1) % phrases.length);
  const handlePrev = () =>
    setPhraseIndex((prev) => (prev - 1 + phrases.length) % phrases.length);

  return (
    <div className="scroll-smooth font-sans">
      {/* Navbar */}
      <header className="fixed w-full backdrop-blur-md bg-white/60 shadow-md z-10">
        <nav className="container mx-auto px-6 py-4 flex justify-between items-center">
          <h1 className="text-2xl font-extrabold text-blue-600 tracking-wide">
            BrandName
          </h1>
          <ul className="flex gap-8 text-md font-medium">
            {["Home", "About", "Features", "Products", "Contact"].map(
              (item) => (
                <li key={item}>
                  <a
                    href={`#${item.toLowerCase()}`}
                    className="hover:text-blue-500 transition-colors duration-200"
                  >
                    {item}
                  </a>
                </li>
              )
            )}
          </ul>
        </nav>
      </header>

      {/* Hero Section */}
      <section
        id="home"
        className="h-screen flex flex-col items-center justify-center bg-gradient-to-br from-blue-100 via-blue-200 to-blue-300"
      >
        <motion.h2
          initial={{ opacity: 0, y: 40 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-6xl font-extrabold text-center text-blue-700 drop-shadow-lg"
        >
          Welcome to Our Website
        </motion.h2>
        <motion.p
          initial={{ opacity: 0, y: 40 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 1, delay: 0.3 }}
          className="mt-6 text-xl text-gray-700"
        >
          We bring you innovation, speed, and quality.
        </motion.p>
      </section>

      {/* About Section with Orbit Bubbles */}
      <section
        id="about"
        className="h-screen flex flex-col items-center justify-center bg-white"
      >
        <div className="relative w-full max-w-3xl h-72 flex justify-center items-center">
          {titles.map((title, index) => {
            const total = titles.length;
            const angleStep = ((360 / total) * Math.PI) / 180;
            const radius = 150;

            const relativeIndex = (index - titleIndex + total) % total;
            const angle = relativeIndex * angleStep;

            const x = radius * Math.cos(angle);
            const y = radius * Math.sin(angle);

            const isActive = index === titleIndex;

            const bubbleStyle = {
              left: `calc(50% + ${x}px)`,
              top: `calc(50% + ${y}px)`,
              transform: `translate(-50%, -50%) scale(${isActive ? 1.25 : 0.9})`,
              zIndex: isActive ? 10 : 1,
            };

            return (
              <motion.div
                key={index}
                onClick={() => setTitleIndex(index)}
                className={`absolute cursor-pointer max-w-[240px] px-6 py-4 rounded-2xl shadow-xl flex items-center gap-3 
                  ${
                    isActive
                      ? "bg-blue-100 ring-2 ring-blue-400"
                      : "bg-gray-100 hover:bg-gray-200"
                  }`}
                style={bubbleStyle}
                animate={{ opacity: isActive ? 1 : 0.6 }}
                transition={{ duration: 0.5 }}
              >
                <img
                  src={gundamHead}
                  alt={title}
                  className="w-10 h-10 object-contain"
                />
                <span
                  className={`text-lg ${
                    isActive ? "text-blue-600 font-bold" : "text-gray-500"
                  }`}
                >
                  {title}
                </span>
              </motion.div>
            );
          })}
        </div>
      </section>

      {/* Features Section with Animated Phrases */}
      <section
        id="features"
        className="h-screen flex items-center justify-center bg-gradient-to-tr from-yellow-100 to-yellow-200"
      >
        <div className="w-full max-w-xl mx-auto text-center py-10">
          <div className="h-24 flex items-center justify-center relative overflow-hidden">
            <AnimatePresence mode="wait">
              <motion.div
                key={phrases[phraseIndex]}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                exit={{ opacity: 0, y: -20 }}
                transition={{ duration: 0.5 }}
                className="text-3xl font-semibold text-yellow-800 drop-shadow-md"
              >
                {phrases[phraseIndex]}
              </motion.div>
            </AnimatePresence>
          </div>
          <div className="mt-6 flex justify-center space-x-4">
            <button className="px-6 py-2 rounded-full bg-yellow-400 text-white font-semibold shadow hover:scale-105 transition-transform" onClick={handlePrev}>
              â¬… Prev
            </button>
            <button className="px-6 py-2 rounded-full bg-yellow-400 text-white font-semibold shadow hover:scale-105 transition-transform" onClick={handleNext}>
              Next âž¡
            </button>
          </div>
        </div>
      </section>

      {/* Contact Section */}
      <section
        id="contact"
        className="h-screen flex flex-col items-center justify-center bg-gradient-to-br from-purple-100 via-purple-200 to-purple-300"
      >
        <h2 className="text-4xl font-bold text-purple-700 drop-shadow-md">
          Let&apos;s Get in Touch
        </h2>
        <p className="mt-4 text-gray-600">We&apos;re here to help anytime.</p>
        <button className="mt-6 px-6 py-2 bg-purple-500 text-white rounded-full shadow hover:scale-105 transition-transform">
          Contact Us
        </button>
      </section>
    </div>
  );
};

export default Home;
